INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 0, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 321, 40011, 24001, 1, 125801, "リリ", 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 0, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 322, 40011, 24001, 1, 126001, "クリア", 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 0, 3, "んーと。\nこれ、あげる。\nはい", 323, 40011, 24001, 1, 126101, "プレシア", 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 0, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 324, 40011, 24001, 1, 125801, "リリ", 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 0, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 325, 40011, 24001, 1, 126001, "クリア", 2);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 0, 6, "お兄。\nきてくれて、うれしい", 326, 40011, 24001, 1, 126101, "プレシア", 2);
